import Card from "@mui/joy/Card";
const DashboardPage = () => {
  return (
    <div>
      <Card size="sm">Small card</Card>
      <Card>Medium card (default)</Card>
      <Card size="lg">Large card</Card>
    </div>
  );
};

export default DashboardPage;
